import React from 'react';
import {Image,Container,Row,Col} from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebook,faInstagram,faLinkedin,faTwitterSquare } from "@fortawesome/free-brands-svg-icons";
function Home() {
    return (
        <div className="header1" style={{ 
          backgroundImage: `url(${process.env.PUBLIC_URL + '/banner.png'})`
        }}>
             <Row className="header-row" >
              <Col xs={1} md={2}>
              </Col>
              <Col xs={5} md={6}>
                <Image src={process.env.PUBLIC_URL + '/foodLove.png'} className="h-50" />
              </Col>
              <Col xs={6} md={4}>
              <FontAwesomeIcon icon={faFacebook} size="lg" transform="left-4" />
              <FontAwesomeIcon icon={faInstagram} size="lg" transform="left-4"/>
              <FontAwesomeIcon icon={faLinkedin} size="lg" transform="left-4"/>
              <FontAwesomeIcon icon={faTwitterSquare} size="lg" transform="left-4"/>
              </Col>
             </Row>
        </div>
    )
}

export default Home
